import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <nav>
      <ul>
        <li>
          <Link to='/'>Главная</Link>
        </li>
        <li>
          <Link to='/articles'>Статьи</Link>
        </li>
        <li>
          <Link to='/video-lessons'>Видеоуроки</Link>
        </li>
        <li>
          <Link to='/gallery'>Галерея</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Header;
